import React from "react";
// eslint-ignore
import { SpriteAnimator } from "react-sprite-animator";

interface CharProps {}

const charComponent: React.FC<CharProps> = (props) => {
  return (
    <SpriteAnimator
      sprite="/assets/monster/bringer-of-death.png"
      width={100}
      height={100}
    />
  );
};

export default charComponent;
